import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Button from '@mui/material/Button';
import AdbIcon from '@mui/icons-material/Adb';

const pages = ['Home', 'Upload & Analysis', 'Feedback'];

function HomePage() {
  return (
    <>
      <AppBar
        position='static'
        style={{ background: 'linear-gradient(to right, #311b92, #000000)' }}
      >
        <Container maxWidth='xl'>
          <Toolbar disableGutters>
            <Box sx={{ flexGrow: 1, display: 'flex', alignItems: 'center' }}>
              <Typography
                variant='h6'
                noWrap
                component='a'
                href='#app-bar-with-responsive-menu'
                sx={{
                  mx: 'auto',
                  fontFamily: 'monospace',
                  fontWeight: 700,
                  letterSpacing: '.3rem',
                  color: 'white',
                  textDecoration: 'none',
                }}
              >
                Design Boost
              </Typography>
            </Box>

            <Box sx={{ display: { xs: 'none', md: 'flex' } }}>
              {pages.map((page) => (
                <Button key={page} sx={{ mx: 2, color: 'white' }}>
                  {page}
                </Button>
              ))}
              <Button sx={{ mx: 2, color: 'white' }}>Sign In</Button>
              <Button
                variant='contained'
                sx={{ mx: 2, color: 'white', backgroundColor: '#6200ea' }}
              >
                Sign Up
              </Button>
            </Box>
          </Toolbar>
        </Container>
      </AppBar>

      <Container sx={{ position: 'relative', overflow: 'hidden' }}>
        <Box
          sx={{
            position: 'absolute',
            top: '50%',
            right: 0,
            transform: 'translateY(-50%)',
            width: '50vw',
            height: '100vh',
            background: 'linear-gradient(to bottom, #311b92, #000000)',
            clipPath: 'ellipse(100% 50% at 100% 50%)',
          }}
        />

        <Box
          sx={{
            position: 'absolute',
            top: '50%',
            left: '5%',
            transform: 'translateY(-50%)',
            textAlign: 'left',
            width: '40%',
          }}
        >
          <Typography
            variant='h3'
            color='white'
            fontWeight={700}
            fontFamily='monospace'
          >
            Unleash the Power of Design
          </Typography>
          <Typography variant='subtitle1' color='white' mt={2}>
            Elevate your UI with Design Boost - Your partner for stunning and
            user-friendly interfaces.
          </Typography>
        </Box>
      </Container>
    </>
  );
}

export default HomePage;
